import styles from "./Nav.module.css";
import logo from "./Logo.png";

import React from "react";

const Nav = () => {
  return (
    <div className={styles.nav}>
      <img src={logo} alt="" />
      <div className={styles.logIn}> <span ></span></div>
    </div>
  );
};

export default Nav;
